	mov	es,ax
	mov	dx,ax
	mov	di,0
	mov	ax, 0x13
	int	10h
	cld
;	jmp paint_setup
;	jmp bmp_setup

gen_rand_num:
	push ax
	push es
	xor ax, ax
	mov es,ax
	mov ax, es:[46Ch] ;offset of var for internal timer in BPB
	mov [randtimer], al
	mov [randshiftnum], ah
	pop es
	pop ax
	cmp word [randtimer], 30
	jge gen_rand_shifts
	mov [randshift0], ax
	jmp paint_setup
	;jmp set_pal

gen_rand_shifts:
	push ax
	mov ax, [randtimer]
	add ax, [randshiftnum]
	mov [randshift0], ax
	pop ax
	jmp paint_setup
;;	randshift0 equ (randtimer+randshiftnum)

set_pal:
	salc				;set carry flag in al, if carry flag set, al=0
	mov	dx,VGA_PAL_INDEX	;
	out	dx, al
	inc	dx
	pal_1:
		;or ax, [randshift0]
		or	ax,0000111100110011b
		or ax, [randtimer]
		push	ax
		shr	ax, 10
		;shr	ax, randshift0
		out	dx,al
		mul	al
		;shl	ax, randshift1
		shl	ax, 6
		out 	dx,al
		pop	ax
		out	dx,al
		inc	ax
		jnz	pal_1
	;jmp 	bmp_setup


