		dec 	cx
		jnz	paint_loop


rsvp:
	mov cx, greetz_len
	mov si, greetz
	push cs
	pop ds
welcome:
	mov al, [si]
	mov bh, 0
	mov bl, 0x0F
	mov ah, 0x0E
	int 0x10
	inc si
	dec cx
	jnz welcome
	jmp key_check

randtimercheck:
	mov cx, 2
	mov si, randtimer
	push cs
	pop ds
randtimerprint:
	mov al, [si]
	mov bh, 0
	mov bl, 0x0F
	mov ah, 0x0E
	int 0x10
	inc si
	dec cx
	jnz randtimerprint
	jmp key_check

;******************************************************************************
;
;	Reads char from buffer (function 0h,int16h)
; 	Char returned in al
; 	If char in al == 0x1b (ESC) then terminate program
;	Else, continue VGA *~pretty picture~* loop
;
;******************************************************************************
key_check:
	xor	ax,ax
	int	16h
	;;check for keypress
	cmp	al, 1
	jnz	baibai
;******************************************************************************
;
;	Terminates program (function 4Ch,int21h)
;
;******************************************************************************
baibai:
	hlt	
	jmp baibai
	;mov	ax,4C00h		;terminate program
	;int	21h

